            k12,
            state
        );


        if (_shouldImprovePrecision(rl, rh, state.fee)) {
            int256 yl;
            (rh, yl) = _computeStep3(
                rl,
                rh,
                k8,
                k12,
                state
            );

            if (_shouldImprovePrecision(rl, rh, state.fee)) {
                int256 yh;
                (rl, rh, yl, yh) = _computeStep4(
                    rl,
                    rh,
                    k8,
                    k12,
                    yl,
                    state
                );

                if (_shouldImprovePrecision(rl, rh, state.fee)) {
                    rl = _computeStep5(
                        rl,
                        rh,
                        yl,
                        yh,
                        k8,
                        k12
                    );
                }
            }
        }
        */

        // Step 6
        rl = _computeStep6(rl);

        // Step 7
        return rl.mul(pA);
    }

    function _bisect(
        int256 a,
        int256 b,
        int256 pA,
        int256 pBarA,
        int256 deltaA,
        IStructs.State memory state
    )
        internal
        returns (int256 r)
    {
        // Compute initial bounds.
        int256 lowerBound = 0;
        int256 upperBound = pA;

        // Cache this value for computations.
        int256 aPlusAmount = a.add(deltaA);

        //
        for (uint256 i = 0; i < 20; ++i) {
            int256 mid = LibScamMath.computeMidpoint(lowerBound, upperBound);
            int256 lhs1 = LibScamMath.computeBaseToNinetyNine(mid.div(pBarA));
            int256 lhs = aPlusAmount
                .mul(lhs1)
                .mul(mid)
                .add(deltaA.mul(mid));
            if (lhs > b) {
                upperBound = mid;
            } else {
                lowerBound = mid;
            }
        }

        return lowerBound;
    }

    function _getCurrentBlockNumber()
        internal
        returns (uint256)
    {
        return block.number;
    }
}

